import { useState } from 'react';
import './App.css';
import './TodoList.js';

function App() {
  const [todos, setTodos] = useState(["Todo1", "Todo2"]);

  return (
    <div>
      <TodoList todos={todos}/>
      <input type="text" />
      <button>タスクの追加</button>
      <button>完了したタスクの削除</button>
      <div>残りのタスク:0</div>
    </div>
  );
}

export default App;
